import React from 'react';
import  logo from '../img/F_icon.png'

const Left = () => {
    return <div className='left-side-app'>
        <a class='logo' href='#'><img src={logo} alt='logo'/></a>
        <nav className='navBar'>
            ul>li*5
        </nav>
    </div>
}
export default Left;
